(150, 1, 'Minas Gerais - Contagem,  , Residencial, (Venda)', '<p>Teste30 - O apto possui uma cozinha equipada de mob&iacute;lia e utens., cooktop, geladeira, bebedouro. Uma sala openspace equipada com mesa em ard&oacute;sia para 4 pessoas e com moderno ventilador de teto, sof&aacute; e poltronas, mais um m&oacute;vel com tv 21&#39;.</p>\r\n\r\n<p>A longa varanda em frente &agrave; sala e cozinha, separada por portas de madeira e vidro, oferece mesa redonda de ard&oacute;sia para 4 pessoas , para tomar cafe, almo&ccedil;ar ou jantar ao som do barulho das ondas e com uma vista deslumbrante.<br />\r\nA suite t&ecirc;m guarda-roupa casal , moderno ventilador de teto, ar condicionado, cama king Size, criado mudo e abajur.</p>\r\n\r\n<p>Os dois grandes quartos sempre com ventilador de teto, ar condicionado e duas cama king size para hospedar inteiras fam&iacute;lias.<br />\r\nO grande banheiro incorporado a suite, oferece conforto &uacute;nico, com v&atilde;os amplos para os chuveiros e &oacute;ptima press&atilde;o d&#39;&aacute;gua que propicia um banho delicioso e relaxante.&nbsp;O aconchegante banheiro social atende a todos.</p>\r\n\r\n<p>O apto &eacute; dotado de roupa de cama, mesa e banho necess&aacute;ria e servi&ccedil;os de limpeza e lavagem s&atilde;o inclu&iacute;dos.&nbsp;Linda a vista da praia e do mar da varanda , da sala , da cozinha , dos quartos e da suite , enfim de quase todos os c&oacute;modos , considerando a &uacute;nica localiza&ccedil;&atilde;o na beira mar.&nbsp;A lavandaria possui pia e grande &aacute;rea de dispensa para armazenar objectos de praia ou prancha de surf ou outros.</p>', '2922', 0, 25, 'Y', 180000.00, 'team/2015/0727/14380131577091.jpg', 'team/2015/0727/14380131949374.jpg', 'team/2015/0727/14380132384274.jpg', 'normal', 0, 1443810224, 1411959600, 1778554800, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, '2018-04-18', '1', 27, 1, 'sim', '', 'MG', 0, 1, 