DROP TABLE IF EXISTS `tipoimoveis`;
CREATE TABLE IF NOT EXISTS `tipoimoveis` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nome` varchar(200) CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=143 ;


DROP TABLE IF EXISTS `user`;
CREATE TABLE IF NOT EXISTS `user` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `tipo` varchar(50) DEFAULT NULL,
  `local` varchar(200) DEFAULT NULL,
  `email` varchar(128) DEFAULT NULL,
  `username` varchar(32) DEFAULT NULL,
  `realname` varchar(32) DEFAULT NULL,
  `bairro` varchar(200) DEFAULT NULL,
  `password` varchar(32) DEFAULT NULL,
  `avatar` varchar(128) DEFAULT NULL,
  `gender` enum('M','F') NOT NULL DEFAULT 'M',
  `newbie` enum('Y','N') NOT NULL DEFAULT 'Y',
  `mobile` varchar(16) DEFAULT NULL,
  `qq` varchar(16) DEFAULT NULL,
  `money` double(10,2) NOT NULL DEFAULT '0.00',
  `score` int(11) NOT NULL DEFAULT '0',
  `zipcode` varchar(10) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `city_id` int(10) unsigned NOT NULL DEFAULT '0',
  `enable` enum('Y','N') NOT NULL DEFAULT 'Y',
  `manager` enum('Y','N') NOT NULL DEFAULT 'N',
  `secret` varchar(32) DEFAULT NULL,
  `recode` varchar(32) DEFAULT NULL,
  `sns` varchar(32) DEFAULT NULL,
  `ip` varchar(16) DEFAULT NULL,
  `login_time` int(10) unsigned NOT NULL DEFAULT '0',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0',
  `fb_userid` varchar(200) DEFAULT NULL,
  `fl_facebook` set('new','normal','registered') DEFAULT 'registered',
  `twitter_userid` varchar(200) DEFAULT NULL,
  `cpf` varchar(255) DEFAULT NULL,
  `senha` varchar(100) DEFAULT NULL,
  `estado` varchar(100) DEFAULT NULL,
  `cidadeusuario` varchar(200) DEFAULT NULL,
  `entrega_cep` varchar(100) DEFAULT NULL,
  `entrega_endereco` varchar(190) DEFAULT NULL,
  `entrega_numero` varchar(100) DEFAULT NULL,
  `entrega_complemento` varchar(190) DEFAULT NULL,
  `entrega_bairro` varchar(100) DEFAULT NULL,
  `entrega_cidade` varchar(190) DEFAULT NULL,
  `entrega_estado` varchar(100) DEFAULT NULL,
  `entrega_telefone` varchar(100) DEFAULT NULL,
  `cobranca_cep` varchar(100) DEFAULT NULL,
  `cobranca_endereco` varchar(190) DEFAULT NULL,
  `cobranca_numero` varchar(100) DEFAULT NULL,
  `cobranca_complemento` varchar(190) DEFAULT NULL,
  `cobranca_bairro` varchar(100) DEFAULT NULL,
  `cobranca_cidade` varchar(190) DEFAULT NULL,
  `cobranca_estado` varchar(100) DEFAULT NULL,
  `cobranca_telefone` varchar(100) DEFAULT NULL,
  `numero` varchar(50) DEFAULT NULL,
  `complemento` varchar(250) DEFAULT NULL,
  `ddd` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UNQ_name` (`username`),
  UNIQUE KEY `UNQ_e` (`email`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=132 ;

 
